    static int[][] unpackTrans(String str, int max) {
        int pos = 0;
        List<int[]> list = new ArrayList<>();
        while (pos < str.length()) {
            int size = (int) str.charAt(pos++);
            int[] arr = new int[max];
            Arrays.fill(arr, -1);
            //i is input id
            for (int i = 0; i < size; i++) {
                arr[str.charAt(pos++)] = str.charAt(pos++);
            }
            list.add(arr);
        }
        return list.toArray(new int[0][]);
    }

